import React from "react";

const ContactPage = () => {
  return (
    <div>
      <h2>
        As first of all, I would like to thank you for visiting my pet project
      </h2>
      <p>As you may guess, this is a dummy page, based on a 40-hour tutorial</p>
      <h5>So no hard feelings</h5>
    </div>
  );
};

export default ContactPage;
